import React from 'react';
import Home from './Home';
import About from './About';
import Blog from './Blog';
import Form from './Form';
import './App.css'
import './Form.css'
import Img from './car.png'

import{Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom';



const App=()=>{

  return(

<body>

<section id="nav">
<a id='a1'>HariCharan</a>
<Router>
<a id='a2'><Link to='/Home' style={{textDecoration:'none',marginLeft:'300px'}}>Science</Link></a>
<a id='a3'><Link to='/About' style={{textDecoration:'none'}}>Technology</Link></a>
<a id='a4'><Link to='/Blog' style={{textDecoration:'none'}}>History</Link></a>
<br></br>
<Switch>

  <Route path="/Home" component={Home}/>
  <Route path="/About" component={About}/>
  <Route path="/Blog" component={Blog}/>

  <Form/>
</Switch>

</Router>
</section>
<section id="navbar">
<div>
  <img src={Img}/>
</div>
</section>
</body>

  );
  }
export default App;
